import React, {useState} from "react";
import {Link} from "react-router-dom";
import {Button} from "@material-ui/core";
import axios from "axios";

function GetFibNum() {
  const [res, getRes] = useState(0);
  const getNum = e => {
    axios
      .post("/fib", {n: e.currentTarget.previousSibling.value})
      .then(resp => getRes(resp.data));
  };
  return (
    <React.Fragment>
      <form name="fib">
        <input type="number" min="1" max="100" placeholder="1" />{" "}
        <Button onClick={getNum}>get</Button>
      </form>
      <div>there will be your num - {res}</div>
      <Link to="/history"> history </Link>
    </React.Fragment>
  );
}

export default GetFibNum;
